INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3001100, 0.0, 130011, "2024/10/31 12:00:00", 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 2, 2.1, -416.5, 100, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3001101, 0.0, 130011, "2024/10/31 12:00:00", 3001, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 2, 5.68, -416.5, 101, 4);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3001102, 0.0, 130011, "2024/10/31 12:00:00", 3001, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 1, 0.0, -416.5, 102, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3002100, 0.0, 130211, "2024/10/31 12:00:00", 3002, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 1, 0.0, -416.5, 100, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3002101, 0.0, 130211, "2024/10/31 12:00:00", 3002, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 1, 0.0, -416.5, 101, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3002102, 0.0, 130211, "2024/10/31 12:00:00", 3002, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 2, 8.53, -416.5, 102, 5);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3002103, 0.0, 130211, "2024/10/31 12:00:00", 3002, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 1, 5.67, -416.5, 103, 7);
