INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", 3002300, 0.0, 130211, "2024/10/31 12:00:00", 3004, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 3, 0.0, -416.5, 300, 3);
